import React from "react";
import { Container, List, Item, Logout } from "./styles";
import { createHashHistory } from "history";

export default function Navigation() {
  const history = createHashHistory();
  async function handleSubmit(e) {
    e.preventDefault();
    history.push("/");
  }

  return (
    <Container>
      <List>
        <Item>
          <img
            alt="ADS"
            src="https://ui-avatars.com/api/?font-size=0.33&background=7159c1&color=fff&name=ADS"
          />
        </Item>
        <Item>
          <img
            alt="ADS"
            src="https://ui-avatars.com/api/?font-size=0.33&background=7159c1&color=fff&name=<"
          />
        </Item>
      </List>
      <Logout onClick={handleSubmit}>Sair</Logout>
    </Container>
  );
}
